apiVersion: v1
kind: ConfigMap
metadata:
  name: mysql-configmap
data:
  schema.sql: |
    CREATE USER 'appuser'@'%' IDENTIFIED BY 'password';
    GRANT ALL PRIVILEGES ON * . * TO 'appuser'@'%';
    FLUSH PRIVILEGES;
    CREATE DATABASE Product;
    USE Product;
    COMMIT;
    CREATE TABLE `Product` (
                               `id` varchar(36) PRIMARY KEY,
                               `name` varchar(255),
                               `description` varchar(255),
                               `price` integer,
                               `type` integer
    );

